import React, { useState } from 'react';
import {
  FlatList,
  Image,
  SafeAreaView,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
} from 'react-native';
import tw from 'tailwind-react-native-classnames';
import { Icon } from 'react-native-elements';
import { useNavigation } from '@react-navigation/native';
import { useSelector } from 'react-redux';
import { selectTravelTimeInformation } from '../slices/navSlice';

const data = [
  {
    id: 'HeyTaxi-X-123',
    title: 'Car',
    multiplier: 0.1,
    image: 'data:image/png;base64,',
  },
  {
    id: 'HeyTaxi-XL-456',
    title: 'Sedan Car',
    multiplier: 0.2,
    image: 'data:image/png;base64,',
  },
  {
    id: 'HeyTaxi_Van',
    title: 'Van',
    multiplier: 0.75,
    image: 'data:image/png;base64,',
  },
];

// If we have SURGE pricing, this goes up
const SURGE_CHARGE_RATE = 0.5;

const RideOptionsCard = () => {
  const navigation = useNavigation();
  const [selected, setSelected] = useState(null);
  const travelTimeInformation = useSelector(selectTravelTimeInformation);

  return (
    <SafeAreaView style={tw`bg-white flex-grow`}>
      <View>
        <TouchableOpacity
          onPress={() => navigation.navigate('NavigateCard')}
          style={tw`absolute top-3 left-5 z-50 p-3 rounded-full`}>
          <Icon name='chevron-left' type='fontawesome' />
        </TouchableOpacity>
        <Text style={tw`text-center p-5 text-xl`}>
          Select a Ride - {travelTimeInformation?.distance?.text}
        </Text>
      </View>

      <FlatList
        data={data}
        keyExtractor={(item) => item.id}
        renderItem={({ item: { id, title, multiplier, image }, item }) => (
          <TouchableOpacity
            onPress={() => setSelected(item)}
            style={tw`flex-row space-between items-center px-10 ${
              id === selected?.id && 'bg-gray-200'
            }`}>
            <Image
              style={{
                width: 100,
                height: 100,
                resizeMode: 'contain',
                marginRight:30,
                marginLeft:-5,
              }}
              source={{ uri: image }}
            />
            <View style={tw`-ml-3`}>
              <Text style={tw`text-xl font-semibold`}>{title}</Text>
              <Text>{travelTimeInformation?.duration?.text}</Text>
            </View>
            <Text style={tw`text-xl ml-6`}>
              {new Intl.NumberFormat('en-us', {
                style: 'currency',
                currency: 'CAD',
              }).format(
                (travelTimeInformation?.duration.value *
                  SURGE_CHARGE_RATE *
                  multiplier) /
                  100
              )}
            </Text>
          </TouchableOpacity>
        )}
      />

      <View style={tw`mt-auto border-t border-gray-300`}>
        <TouchableOpacity
          disabled={!selected}
          style={tw`bg-black py-3 m-3 rounded-full ${
            !selected && 'bg-gray-300'
          }`}>
          <Text style={tw`text-center text-white text-xl`}>
            Choose {selected?.title}
          </Text>
        </TouchableOpacity>
      </View>
    </SafeAreaView>
  );
};

export default RideOptionsCard;

const styles = StyleSheet.create({});